	 * @param {object} props
	 */
	constructor(props){
		super(props);
		this.state = {
			message: props.label,
			inConfirm: false
		};
		this.handleClick = this.handleClick.bind(this);
	}

	/**
	 * Handle button clicks
	 *
	 * On first click, change to confirm message,
	 * On second click, call onClick prop
	 */
	handleClick(){
		if (false === this.state.inConfirm) {
			this.setState({
				message: this.props.labelToConfirm,
				inConfirm:true
			})
		} else {
			this.props.onClick();
		}
	}

	/**
