/**
 * Factory for single processor configs
 *
 * @param {Object} configField Config fields for processor config field.
 * @param {Object} configFieldDefaults Optional. Config field defaults for processor config field.
 * @returns {{}}
 */
export const configFieldFactory = (configField, configFieldDefaults = {} ) => {
	return {
		...configFieldDefaults,
		...configField,
	};

};

import {configFieldFactory} from './configFieldFactory';
/**
 * Prepare a collection of config fields
 *
 * Optionally merges with default config fields
 * Optionally sets values from a Map of config values
 *
 * @param {Object} configFields Config fields for processor. Indexed by config ID.
 * @param {Object} configFieldsDefaults Optional. Config field defaults for processor. Indexed by config ID.
 * @returns {Object}
 */
export const configFieldsFactory = (configFields, configFieldsDefaults = {}  ) => {
	Object.keys( configFields ).forEach( configFieldId => {
		if( configFieldsDefaults.hasOwnProperty(configFieldId)){
			configFields[configFieldId] = configFieldFactory(
				configFields[configFieldId],
				configFieldsDefaults[configFieldId]
			);

		}
	});

	Object.keys( configFieldsDefaults ).forEach( configDefaultId => {
		if( ! configFields.hasOwnProperty(configDefaultId)){
			configFields[configDefaultId] = configFieldsDefaults[configDefaultId];
		}
	});

	Object.keys( configFields ).forEach(configFieldId  => {
		configFields[configFieldId].id = configFieldId;
		configFields[configFieldId].ID = configFieldId;
	});

	return configFields;
};

import {configFieldsFactory} from './configFieldsFactory';
import {processorTypes} from '../processors/processorTypes';

export const processorTypesMap = new Map();
Object.values(processorTypes).forEach( type =>{
	processorTypesMap.set(type.TYPE, type);
});


/**
 * Get the configuration for a processor
 *
 * This will merge in defaults, and set values from supplied configValues.
 * Does not provide callback functions for updating those values.
 * Those callback functions MUST get added before they are used in the default manner.
 *
 * @param {String} ID
 * @param {String} type
 * @param {Map} processorTypes
 * @param {Object} configFields Config fields for processor. Indexed by config ID.
 */
export const processorFactory = ( ID, type, configFields = {}, processorTypes = processorTypesMap ) =>  {
	let processor = {
		ID,
		type,
		configFields
	};
	if( processorTypes.has( type ) ){
		const configFieldDefaults =
			processorTypes.get( type ).hasOwnProperty( 'defaultConfigFields' )
				? processorTypes.get( type ).defaultConfigFields
				: {};

		processor.configFields = configFieldsFactory(configFields,configFieldDefaults);

	}
	return processor;

};

/**
 * Finds value property of config field or config field default
 * @param {Object} configField Config field to search for default in
 * @returns {String|Number|Array|null}
 */
export const getConfigFieldValue = (configField) => {
	return 'object' === typeof configField && configField.hasOwnProperty('value')
		? configField.value
		: null;
};

/**
 * Finds default property of config field or config field default
 * @param {Object} configField Config field to search for default in
 * @returns {String|Number|Array|null}
 */
export const getConfigFieldDefaultValue = (configField) => {
	return 'object' === typeof configField && configField.hasOwnProperty('default')
		? configField.default
		: null;
};

/**
 * Finds value of config field, falling back to default value
 * @param {Object} configField Config field to search for value or defualt in
 * @returns {String|Number|Array|null}
 */
export const getConfigFieldValueOrDefault = (configField) => {
	return null !== getConfigFieldValue(configField)
		? getConfigFieldValue(configField)
		: null !== getConfigFieldDefaultValue(configField)
			? getConfigFieldDefaultValue(configField)
			: null;
};

/**
 * Convert an object (should have meaningful indexes) to a map
 * @param {Object} object Object to convert
 * @return {Map<any, any>}
 */
export const objectToMap = (object) => {
	const map = new Map();
	Object.keys(object).forEach(key => {
		map.set(key, object[key]);
	});
	return map;
};

/**
 * Add an ID prop, to all objects of a Map, using map's key.
 * @param {Map} theMap The map to add key as ID property to values of
 */
export const mapKeysToIdProperty = (theMap) => {
	theMap
		.forEach((value, key, map) => {
			if ('object' === typeof  value) {
				map.set(key, {
					...value,
					ID: key,
					id: key
				});
			}

		});
	return theMap;

};


/**
 * Check configField conditionals.
 *
 * Returns false if any conditionals fail.
 * Returns true if no conditionals fail, or there are no conditionals.
 *
 * @param {Object} configField The field to check the conditionals of.
 * @param {Object} fieldValues Optional. Data to pass to conditional rule callbacks
 * @return {boolean}
 */
export const checkConfigFieldConditionals = (configField, fieldValues = {}) => {
	if (!configField.hasOwnProperty('conditionals') || !Array.isArray(configField.conditionals)) {
		return true;
	}

	let allRulesPassed = true;
	configField.conditionals.forEach(conditional => {
		if ('function' === typeof conditional && false === conditional.call(null, fieldValues)) {
			allRulesPassed = false;
			return false;
		}
	});

	return allRulesPassed;

};

/**
 * Check conditionals for a collection of configFields
 *
 * Returns false if any conditionals fail.
 * Returns true if no conditionals fail, or there are no conditionals.
 *
 * @param {Array} configFields The fields to check the conditionals of.
 * @param {Object} fieldValues Optional. Data to pass to conditional rules' callbacks
 * @return {boolean}
 */
export const checkConfigFieldsConditionals = (configFields, fieldValues = {}) => {
	let results = {};
	Object.values( configFields ).forEach(configField => {
		results[configField.ID] = checkConfigFieldConditionals(configField,fieldValues);
	});
	return results;

};

/**
 * Get the current values for prepareConfigFields
 *
 * @param configFields
 */
export const reduceConfigFieldsToValues = (configFields) => {
	let values = {};
	 configFields.forEach(field => {
	 		values[field.ID] = field.value
			? field.value
			: field.default
				? field.default
				: null;
	 });
	 return values;
};

